import React from "react";
import { SafeAreaView, TextInput } from "react-native";

 const Signup = (props) => {
  return (
    <SafeAreaView>
      <TextInput style={styles.input} placeholder="Correo" />
    </SafeAreaView>
  );
}
const styles = StyleSheet.create({
  input: {
    margin: 3,
  },
});
